	let cont i = action i i tk (HappyState action) sts stk tks in
	case tk of {
	TSymbol _ "#" -> cont 77;
	TSymbol _ "(" -> cont 78;
	TSymbol _ ")" -> cont 79;
	TSymbol _ "," -> cont 80;
	TSymbol _ "->" -> cont 81;
	TSymbol _ "." -> cont 82;
	TSymbol _ ".." -> cont 83;
	TSymbol _ "::" -> cont 84;
	TSymbol _ ";" -> cont 85;
	TSymbol _ "<-" -> cont 86;
	TSymbol _ "=" -> cont 87;
	TSymbol _ "=>" -> cont 88;
	TSymbol _ "@" -> cont 89;
	TSymbol _ "Array" -> cont 90;
	TSymbol _ "[" -> cont 91;
	TSymbol _ "\\" -> cont 92;
	TSymbol _ "]" -> cont 93;
	TSymbol _ "as" -> cont 94;
	TSymbol _ "branch" -> cont 95;
	TSymbol _ "case" -> cont 96;
	TSymbol _ "do" -> cont 97;
	TSymbol _ "exports" -> cont 98;
	TSymbol _ "extern" -> cont 99;
	TSymbol _ "imports" -> cont 100;
	TSymbol _ "in" -> cont 101;
	TSymbol _ "instance" -> cont 102;
	TSymbol _ "let" -> cont 103;
